import ExpenseItem from "./ExpenseItem";
import "./Expenses.css";

function Expenses() {
  return (
    <div className="expenses">
      <ExpenseItem
        expenseDate={new Date(2022, 10, 23)}
        expenseTitle="car insurance"
        expenseAmount={294.67}
      />
    </div>
  );
}

export default Expenses;
